import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Card } from './components/card'
import { Layout } from './components/Layout';

function App() {
  return (
    <Layout>
      <div>
        Hello World
        <Card id={1}
          paragrafo='NExt'
          details='A aceleração da sua fintech'
        />
        <Card id={2}
          paragrafo='LIFT'
          details='Aceleração'
        />
      </div>
    </Layout>

  );
}

export default App;
